import Draggable from "react-draggable";
import { Card } from "react-bootstrap";
import { useDraggble } from "../../contexts/DraggableContext";

export const Circle = () => {
  const { positions, handleStop, handleStart } = useDraggble();
  const id = "circle";
  return (
    <Draggable
      position={positions[id]}
      onStart={handleStart(id)}
      onStop={handleStop(id)}
    >
      <Card className="mb-2 rounded-circle">
        <Card.Body className="text-center">Circle</Card.Body>
      </Card>
    </Draggable>
  );
};
